#include "includes.h"
#include "TalComponent.h"

TalComponent::TalComponent (TalCore* const ownerFilter)
: AudioProcessorEditor (ownerFilter)
{
    Image backgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
	Image knowWhiteImage = ImageCache::getFromMemory(bmp00129_png, bmp00129_pngSize);
	Image knowRedImage = ImageCache::getFromMemory(bmp00130_png, bmp00130_pngSize);
	Image buttonImage = ImageCache::getFromMemory(bmp00132_png, bmp00132_pngSize);
	Image splashImage = ImageCache::getFromMemory(bmp00133_png, bmp00133_pngSize);

    MemoryInputStream mis(electronichighwaysign, electronichighwaysignSize, false);
    this->typeface = new CustomTypeface(mis);
    Font fontDigital(typeface);
    fontDigital.setSizeAndStyle(13.0f, 0, 0.7f, 0.0f);

    this->lowShelfGainSlider = addSlider(this, 21, 39, ownerFilter, knowWhiteImage, 186, LOWSHELFGAIN);
    this->highShelfGainSlider = addSlider(this, 84, 39, ownerFilter, knowWhiteImage, 186, HIGHSHELFGAIN);

    this->decayTimeSlider = addSlider(this, 145, 39, ownerFilter, knowWhiteImage, 186, DECAYTIME);
    this->stereoWidthSlider = addSlider(this, 208, 39, ownerFilter, knowWhiteImage, 186, STEREO);
    this->preDelaySlider = addSlider(this, 271, 39, ownerFilter, knowWhiteImage, 186, PREDELAY);

    this->drySlider = addSlider(this, 358, 39, ownerFilter, knowRedImage, 186, DRY);
    this->wetSlider = addSlider(this, 421, 39, ownerFilter, knowRedImage, 186, WET);

    this->realStereoModeButton = addNormalButton(this, 455, 2, ownerFilter, buttonImage, false, REALSTEREOMODE);
    this->powerButton = addNormalButton(this, 540, 2, ownerFilter, buttonImage, false, POWER);

	// Version info
	this->versionLabel = new Label(T("Version Info"), T("V 0.96"));
    this->versionLabel->setFont(fontDigital);
	this->versionLabel->setBounds(20, 3, 100, 20);
	this->versionLabel->setColour(Label::textColourId, Colour((juce::uint8)200, (juce::uint8)200, (juce::uint8)200, 1.0f));
	addAndMakeVisible(this->versionLabel);

	this->infoLabel = new Label(T("Info text"), T(""));
    this->infoLabel->setFont(fontDigital);
	this->infoLabel->setBounds(100, 3, 100, 20);
	this->infoLabel->setColour(Label::textColourId, Colour((juce::uint8)200, (juce::uint8)200, (juce::uint8)200, 1.0f));
	addAndMakeVisible(this->infoLabel);

    this->talMeter = new TalMeter(ownerFilter, 77, 225, 20);
    this->talMeter->setBounds(500, 30, 77, 254);
    addAndMakeVisible(this->talMeter);

    this->splashScreen = new TalSplashScreen(splashImage, 0, 311, 329, 51);
    addAndMakeVisible(this->splashScreen);

    updateParametersFromFilter();

    setSize(backgroundImage.getWidth(), backgroundImage.getHeight());

    // register ourselves with the filter - it will use its ChangeBroadcaster base
    // class to tell us when something has changed, and this will call our changeListenerCallback()
    // method.
    ownerFilter->addChangeListener (this);
}

TalComponent::~TalComponent()
{
    getFilter()->removeChangeListener(this);
    deleteAllChildren();
}

ImageToggleButton* TalComponent::addNormalButton(Component *component, int x, int y, TalCore* const ownerFilter, const Image buttonImage, bool isKickButton, int parameter)
{
	ImageToggleButton *imageToggleButton;
	component->addAndMakeVisible(imageToggleButton = new ImageToggleButton("Toggle Button", buttonImage, false, isKickButton, parameter));
    imageToggleButton->setBounds(x, y, buttonImage.getWidth(), buttonImage.getHeight() / 2);
	imageToggleButton->addListener(this);
	return imageToggleButton;
}

ImageSlider* TalComponent::addSlider(Component *component, int x, int y, TalCore* const ownerFilter, const Image sliderImage, int height, int parameter)
{
	ImageSlider *imageSlider;
	component->addAndMakeVisible(imageSlider = new ImageSlider(sliderImage, height, parameter));
	imageSlider->setBounds(x, y, /*sliderImage->getWidth()*/ 70, height + sliderImage.getHeight());
	imageSlider->addListener (this);
	return imageSlider;
}

//==============================================================================
void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.9f));

    Image backgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
    g.drawImage (backgroundImage,
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight(),
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight());
}

void TalComponent::sliderDragStarted (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getFilter();
        filter->beginParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderDragEnded (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getFilter();
        filter->endParameterChangeGesture(values["index"]);
    }
}

void TalComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();

    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        filter->setParameterNotifyingHost(values["index"], (float)caller->getValue());
    }

    this->updateInfo(caller);
}

void TalComponent::updateInfo(Slider* caller)
{
    if (caller == preDelaySlider) this->infoLabel->setText(juce::String((int)(audioUtils.getLogScaledValue((float)preDelaySlider->getValue()) * 1000.0f)) + T(" ms"), dontSendNotification);
    if (caller == lowShelfGainSlider) this->infoLabel->setText(juce::String(lowShelfGainSlider->getValue(), 4), dontSendNotification);
    if (caller == highShelfGainSlider) this->infoLabel->setText(juce::String(highShelfGainSlider->getValue(), 4), dontSendNotification);

    if (caller == stereoWidthSlider) this->infoLabel->setText(juce::String(stereoWidthSlider->getValue(), 4), dontSendNotification);
    if (caller == decayTimeSlider) this->infoLabel->setText(juce::String(decayTimeSlider->getValue(), 4), dontSendNotification);

    if (caller == drySlider) this->infoLabel->setText(juce::String(audioUtils.getLogScaledValueInDecibelFilter((float)drySlider->getValue(), 2), 4) + T(" dB"), dontSendNotification);
    if (caller == wetSlider) this->infoLabel->setText(juce::String(audioUtils.getLogScaledValueInDecibelFilter((float)wetSlider->getValue(), 2), 4) + T(" dB"), dontSendNotification);
}

void TalComponent::buttonClicked (Button* caller)
{
    TalCore* const filter = getFilter();

    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        filter->setParameterNotifyingHost(values["index"], (float)caller->getToggleState());
    }
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float roomSize = filter->getParameter(DECAYTIME);
	float preDelay = filter->getParameter(PREDELAY);

	float lowShelfGain = filter->getParameter(LOWSHELFGAIN);
	float highShelfGain = filter->getParameter(HIGHSHELFGAIN);

	float stereo = filter->getParameter(STEREO);

	float dry = filter->getParameter(DRY);
	float wet = filter->getParameter(WET);

	float realStereoMode = filter->getParameter(REALSTEREOMODE);
	float power = filter->getParameter(POWER);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	this->decayTimeSlider->setValue(roomSize, dontSendNotification);
	this->preDelaySlider->setValue(preDelay, dontSendNotification);
	this->lowShelfGainSlider->setValue(lowShelfGain, dontSendNotification);
	this->highShelfGainSlider->setValue(highShelfGain, dontSendNotification);
	this->stereoWidthSlider->setValue(stereo, dontSendNotification);

	this->drySlider->setValue(dry, dontSendNotification);
	this->wetSlider->setValue(wet, dontSendNotification);

    this->realStereoModeButton->setToggleState(realStereoMode > 0.0f, dontSendNotification);
    this->powerButton->setToggleState(power > 0.0f, dontSendNotification);
}

